function App() {
  return (
    <div>
      <BrowserRouter>
        <Navbar />
        <Routes>
          <Route path='/' element={<Shop />} />
          <Route path='/dog/food' element={<ShopCategory banner={dogs_banner} category="dog" />} />
          <Route path='/dog/food' element={<ShopCategory banner={dogs_banner} category="dog" />} />
          <Route path='/cat/food' element={<ShopCategory banner={cats_banner} category="cat" />} />
          <Route path='/cat/food' element={<ShopCategory banner={cats_banner} category="cat" />} />
          <Route path='/bird' element={<ShopCategory banner={birds_banner} category="bird" />} />
          <Route path='/discounts' element={<ShopDiscount />} />
          <Route path='/brand/:brandName' element={<ShopBrand />} />
          <Route path='/product' element={<Product />}>
            <Route path=':productId' element={<Product />} />
          </Route>
          <Route path='/cart' element={<Cart />} />
          <Route path='/order' element={<Order />} />
        </Routes>
        <Carousel />
        <Footer />
      </BrowserRouter>
    </div>
  );
}

export default App;
